-- Copiando estrutura para trigger prospere.trg_BaixaParcela
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO';
DELIMITER //
CREATE TRIGGER `trg_BaixaParcela` BEFORE UPDATE ON `parcela` FOR EACH ROW BEGIN

   DECLARE vPercentual float(10,2);
   DECLARE vMulta float(10,2);
   
   IF NEW.pago = '1' && NEW.vl_total_pago != 0 THEN
		   IF NEW.vl_parcela + NEW.vl_juros + NEW.vl_multa - NEW.desconto != NEW.vl_total_pago THEN
				SELECT b.multa INTO vPercentual
				FROM PARCELA AS p
				JOIN CONTRATO AS c ON c.id = p.id_contrato
				JOIN LOTES AS l ON c.id_lote = l.id
				JOIN BANCO AS b ON b.id_empreendimento = l.id_empreendimento
				WHERE p.id_parcela_contrato = id_parcela_contrato
				LIMIT 1;	
				SET vMulta = ROUND(NEW.vl_parcela * vPercentual *0.01,2);
				IF vMulta + NEW.vl_parcela - NEW.desconto <= NEW.vl_total_pago THEN
					SET NEW.vl_multa = vMulta;
					SET NEW.vl_juros = (NEW.vl_total_pago - (vMulta + NEW.vl_parcela - NEW.desconto));
				ELSEIF vMulta + NEW.vl_parcela - NEW.desconto > NEW.vl_total_pago THEN
					SET NEW.vl_juros = (NEW.vl_total_pago - (NEW.vl_parcela - NEW.desconto));
					SET NEW.vl_multa = 0;
				END IF;
			END IF;
	END IF;
END//
DELIMITER ;
