REPLACE INTO `carta_cobranca` (`cd_carta_cobranca`, `nm_titulo_carta`, `ds_texto_cima`, `ds_texto_baixo`, `tp_carta_cobranca`, `tp_carta`, `ds_log`) VALUES
	(7, '1ª carta- Prospere', '<p>Encontra-se em aberto, em nossos controles, o pagamento da(s) parcela(s) mensal(is), abaixo relacionadas, referente ao contrato acima mencionado.</p>\r\n', '<p>Solicitamos a gentileza de entrar em contato com o setor de cobran&ccedil;a, para darmos solu&ccedil;&atilde;o a pend&ecirc;ncia atrav&eacute;s do pagamento dos valores devidos. No aguardo de uma breve resposta, somos desde j&aacute; agradecidos pela aten&ccedil;&atilde;o.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>P.S.: Dessa forma, caso o(s) referido(s) pagamento(s) j&aacute; tenha(m) sido efetuado(s), favor entrar em contato via telefone: (83) 3512-5331, e-mail: cobranca@prospereadm.com.br ou comparecer ao nosso escrit&oacute;rio regional&nbsp;<strong>para envio do(s) comprovante(s) de pagamento</strong>&nbsp;e &agrave; efetiva baixa de seu(s) t&iacute;tulo(s) em aberto - Av. Julio Brasileiro, 165 (em frente ao Posto Imperador), Heli&oacute;polis, Garanhuns-PE. &nbsp;</p>\r\n', '30', 'CC', 'suporte - 08/11/2016 10:11:25 - i'),
	(8, '3 carta - Prospere', '<p>Constatamos que, apesar de devidamente notificado (a) para regularizar o d&eacute;bito existente em vosso nome, V.Sa. n&atilde;o atendeu &agrave;s nossas convoca&ccedil;&otilde;es para regularizar o(s) seguinte(s) d&eacute;bito(s) em seu nome:&nbsp;</p>\r\n', '<p>Com efeito, somando-se 03 (tr&ecirc;s) parcelas consecutivas em atraso e/ou 90 (noventa) dias em mora de uma &uacute;nica presta&ccedil;&atilde;o, vimos NOTIFIC&Aacute;-LO, mais uma vez, para quitar o saldo devedor acima apresentado no prazo m&aacute;ximo de 10 (dez) dias na sede desta empresa, sob pena de rescis&atilde;o do contrato em comento, nos termos da Cl&aacute;usula 12 do referido instrumento particular e nos do artigo 475 do C&oacute;digo Civil Brasileiro.</p>\r\n\r\n<p>P.S.: Dessa forma, caso o(s) referido(s) pagamento(s) j&aacute; tenham sido efetuado(s), favor entrar em contato via telefone: (83) 3225-4080, email: cobranca@prospereadm.com.br ou comparecer a um de nossos escritorios regionais <strong>para o envio dos comprovantes de pagamento</strong> para fazer a efetiva baixa de seus titulos em aberto.</p>\r\n', '3C', 'CC', 'suporte - 08/11/2016 10:11:55 - i'),
	(9, '5 carta - Prospere', '<p>Tendo em vista o n&atilde;o comparecimento ao nosso chamado para quitar o seu d&eacute;bito, comunicamos que, de acordo com o estipulado no Contrato de Compra e Venda firmado com V.Sa., o mesmo se encontra rescindido de pleno direito, de modo que estaremos renegociando a(s) sua(s) unidade(s) com um novo adquirente, no prazo de 05 (cinco) dias. Parcelas em atraso:</p>\r\n', '<p>Solicitamos a gentileza de entrar em contato com o setor de cobran&ccedil;a pelo telefone (83) 3225-4080, para darmos solu&ccedil;&atilde;o a pend&ecirc;ncia atrav&eacute;s do pagamento dos valores devidos e/ou caso seja de vosso interesse o cancelamento pedimos ligar informando dados de banco, ag&ecirc;ncia e conta, para a devolu&ccedil;&atilde;o atrav&eacute;s de depositos dos percentuais pagos conforme consta em contrato.</p>\r\n\r\n<p>Dessa forma, caso o(s) referido(s) pagamento(s) j&aacute; tenham sido efetuado(s), favor entrar em contato via telefone ou email: cobranca@prospereadm.com.br para o envio dos comprovantes de pagamento para que possamos dar efetiva baixa de seus titulos em aberto.</p>\r\n\r\n<p>No aguardo de uma breve resposta, somos desde j&aacute; agradecidos pela aten&ccedil;&atilde;o.&nbsp;</p>\r\n', '5C', 'CC', 'suporte - 07/11/2016 18:11:30 - i'),
	(11, '9 carta - Prospere', '<p>Informamos que sua unidade j&aacute;&nbsp;foi disponibilizada para revenda. Reiteramos a comunica&ccedil;&atilde;o expressa da correspond&ecirc;ncia anterior, no sentido de que parte dos valores pagos por V.Sa. conforme regras contratuais,&nbsp;permanece ao seu dispor em nosso escrit&oacute;rio.&nbsp;</p>\r\n', '<p>Solicitamos a gentileza de entrar em contato com o setor de cobran&ccedil;a pelo telefone (83) 3225-4080 ou email&nbsp;cobranca@prospereadm.com.br, para informar dados banc&aacute;rios para que possamos fazer as referidas restitui&ccedil;&otilde;es atrav&eacute;s de depositos banc&aacute;rios.</p>\r\n\r\n<p>Caso o(s) referido(s) pagamento(s) j&aacute; tenham sido efetuado(s), favor desconsiderar essa correspond&ecirc;ncia,&nbsp;entrar em contato via telefone: (83) 3225-4080&nbsp;ou comparecer a um de&nbsp;nossos escrit&oacute;rios regionais&nbsp;e &nbsp;enviar c&oacute;pia&nbsp;dos comprovantes de pagamento&nbsp;por email&nbsp;cobranca@prospereadm.com.br&nbsp;para que possamos localiza-los junto a institui&ccedil;&atilde;o banc&aacute;ria.</p>\r\n', '6C', 'CC', 'suporte - 08/11/2016 10:11:02 - i'),
	(12, 'Termo de Distrato', '<p>O cliente abaixo indicado declara, outrosim, que concorda com a condi&ccedil;&atilde;o de pagamento da devolu&ccedil;&atilde;o, a qual lhe &eacute; devida em caso de desist&ecirc;ncia, nada mais tendo dela reclamar, no presente ou no futuro, judicial ou extrajudicial</p>\r\n', '<p>A empresa n&atilde;o se responsabilida pela falta de pagamento devido a dados bancarios fornecidos com erros ou por contas encerradas.</p>\r\n', 'TD', 'CD', 'suporte - 04/04/2017 13:04:36 - i'),
	(13, 'Carta de Rescisao', '<p>Na data abaixo declarada (data de contrato) , foi assinado contrato de compra e venda entre o COMPRADOR e VENDEDOR, envolvendo o lote e quadra mencionados. No entanto, devido ao atraso consecutivo de 03 (tres) parcelas, conforme estipulado em contrato assinado entre as partes, o mesmo fica automaticamente DISTRATADO.</p>\r\n\r\n<p>Para o recebimento do valor devido pedimos que entre em contato com nossa unidade fornecendo dados de banco, agencia e conta.</p>\r\n', '<p>Em raz&atilde;o disso, vez que o contrato est&aacute;desde ja rescindido, deve o COMPRADOR promover o retorno do bem ao VENDEDOR, no prazo maximo de 48 (quarenta e oito) hs a partir do recebimento desta.</p>\r\n', 'CR', 'CD', 'suporte - 04/04/2017 12:04:14 - i'),
	(14, '1 carta - Modelo Novo', '<p>Encontra-se em aberto, em nossos controles, o pagamento da(s) parcela(s) mensal(is), abaixo relacionadas, referente ao contrato acima mencionado.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>Solicitamos a gentileza de entrar em contato com o setor de cobran&ccedil;a, para darmos solu&ccedil;&atilde;o a pend&ecirc;ncia atrav&eacute;s do pagamento dos valores devidos. No aguardo de uma breve resposta, somos desde j&aacute; agradecidos pela aten&ccedil;&atilde;o.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>P.S.: Dessa forma, caso o(s) referido(s) pagamento(s) j&aacute; tenham sido efetuado(s), favor entrar em contato via telefone: (83) 3225-4080, email: cobranca@prospereadm.com.br ou comparecer a um de nossos escritorios regionais <strong>para o envio dos comprovantes de pagamento</strong>&nbsp;para que possamos fazer a efetiva baixa de seus titulos em aberto.</p>\r\n', 'CC', 'CC', 'clea - 08/03/2017 16:03:20 - i'),
	(15, '3 carta - Modelo Novo', '<p>Constatamos que, apesar de devidamente notificado (a) para regularizar o d&eacute;bito existente em vosso nome, V.Sa. n&atilde;o atendeu &agrave;s nossas convoca&ccedil;&otilde;es para regularizar o(s) seguinte(s) d&eacute;bito(s) em seu nome:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>Com efeito, somando-se 03 (tr&ecirc;s) parcelas consecutivas em atraso e/ou 90 (noventa) dias em mora de uma &uacute;nica presta&ccedil;&atilde;o, vimos NOTIFIC&Aacute;-LO, mais uma vez, para quitar o saldo devedor acima apresentado no prazo m&aacute;ximo de 10 (dez) dias na sede desta empresa, sob pena de rescis&atilde;o do contrato em comento, nos termos da Cl&aacute;usula 12 do referido instrumento particular e nos do artigo 475 do C&oacute;digo Civil Brasileiro.</p>\r\n\r\n<p>Comunicamos, ainda,que a permanecer a inadimpl&ecirc;ncia, o contrato ser&aacute; encaminhado ao setor jur&iacute;dico, para ado&ccedil;&atilde;o das provid&ecirc;ncias judiciais cab&iacute;veis.</p>\r\n\r\n<p>P.S.: Dessa forma, caso o(s) referido(s) pagamento(s) j&aacute; tenham sido efetuado(s), favor entrar em contato via telefone: (83)3225-4080, email: cobranca@prospereadm.com.br ou comparecer a um de nossos escritorios regionais <strong>para o envio dos comprovantes de pagamento</strong> para que fazer a efetiva baixa de seus titulos em aberto.</p>\r\n', 'CC', 'CC', 'clea - 08/03/2017 16:03:35 - i'),
	(16, '5 carta - Modelo Novo', '<p>Tendo em vista o n&atilde;o comparecimento ao nosso chamado para quitar o seu d&eacute;bito, comunicamos que, de acordo com o estipulado no Contrato de Compra e Venda firmado com V.Sa., o mesmo se encontra rescindido de pleno direito, de modo que estaremos renegociando a(s) sua(s) unidade(s) com um novo adquirente, no prazo de 05 (cinco) dias. Parcelas em atraso:</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>&nbsp;</p>\r\n\r\n<p>Solicitamos a gentileza de entrar em contato com o setor de cobran&ccedil;a pelo telefone (83) 3225-4080, para darmos solu&ccedil;&atilde;o a pend&ecirc;ncia atrav&eacute;s do pagamento dos valores devidos e/ ou caso seja de vosso interesse mesmo o cancelamento pedimos ligar informando dados de banco, agencia e conta, para a devolu&ccedil;&atilde;o atrav&eacute;s de depositos dos percentuais pagos conforme consta em contrato.</p>\r\n\r\n<p>Comunicamos, ainda,que a permanecer a inadimpl&ecirc;ncia, o contrato ser&aacute; encaminhado ao setor jur&iacute;dico, para ado&ccedil;&atilde;o das provid&ecirc;ncias judiciais cab&iacute;veis.</p>\r\n\r\n<p>Dessa forma, caso o(s) referido(s) pagamento(s) j&aacute; tenham sido efetuado(s), favor entrar em contato via telefone ou email: cobranca@prospereadm.com.br para o envio dos comprovantes de pagamento para que possamos dar efetiva baixa de seus titulos em aberto.</p>\r\n\r\n<p>No aguardo de uma breve resposta, somos desde j&aacute; agradecidos pela aten&ccedil;&atilde;o.&nbsp;</p>\r\n', 'CC', 'CC', 'clea - 08/03/2017 16:03:21 - i'),
	(17, 'Aviso parcelas', '<p>Parcelas que constam em aberto em nosso sistema:</p>\r\n', '<p>Caso tenham sido pagas nos enviem os comprovantes por e-mail cobranca@prospereadm.com.br para a devida baixa.</p>\r\n\r\n<p>Ou caso n&atilde;o tenham sido pagas estamos a disposi&ccedil;&atilde;o para negocia&ccedil;&otilde;es a fim de evitar perda de lote por inadimplencia.</p>\r\n', 'CC', 'CC', 'clea - 08/03/2017 16:03:18 - i'),
	(18, '9 carta - Modelo Novo', '<p>Informamos que sua unidade j&aacute;&nbsp;foi disponibilizada para revenda. Reiteramos a comunica&ccedil;&atilde;o&nbsp;expressa da correspond&ecirc;ncia anterior, no sentido de que parte dos valores pagos por V.Sa. conforme regras contratuais,&nbsp;permanece ao seu dispor em nosso escrit&oacute;rio.</p>\r\n', '<p>Solicitamos a gentileza de entrar em contato com o setor de cobran&ccedil;a pelo telefone (83) 3225-4080 ou (83) 9-9981-3355 ou&nbsp;e-mail cobranca@prospereadm.com.br, para informar dados de Banco para&nbsp;que possamos fazer as referidas restitui&ccedil;&otilde;es atrav&eacute;s de depositos banc&aacute;rios.</p>\r\n\r\n<p>Caso o(s) referido(s) pagamento(s) j&aacute;&nbsp;tenham sido efetuado(s), favor desconsiderar essa correspond&ecirc;ncia, entrar em contato pelo telefone&nbsp;(83) 3225-4080, ou comparecer ao nosso escrit&oacute;rio localizado na&nbsp;Av.Acre,446,sala 202, Bairro dos Estados, e enviar&nbsp;c&oacute;pia do comprovante de pagamento por&nbsp;email: cobranca@prospereadm.com.br&nbsp;para que possamos localiza-los junto a institui&ccedil;&atilde;o bancaria.</p>\r\n', 'CC', 'CC', 'clea - 09/03/2017 09:03:57 - i'),
	(19, 'Mudança de Administração', '<p>Informamos atrav&eacute;s desta que a administra&ccedil;&atilde;o de seu loteamento a partir de agora est&aacute; sob responsabilidade da Prospere Administra&ccedil;&atilde;o Imobiliaria Ltda- ME que lhe d&aacute; as boas vindas.&nbsp;</p>\r\n', '<p>Aproveitamos para informar que toda e qualquer d&uacute;vida referente a administra&ccedil;&atilde;o deste loteamento deve ser dada, &uacute;nica e exclusivamente, atrav&eacute;s de um de nossos canais de contato listados a seguir: - Fones: (83) 3225-4080 - (83) 9 9981-3355 - (83) 9 9981-3344 - E-mail: administracao@prospereadm.com.br - Endere&ccedil;o: Av. Acre, 446, sala 202 - Jo&atilde;o Pessoa - PB&nbsp;&nbsp;Agradecemos a aten&ccedil;&atilde;o e estaremos a disposi&ccedil;&atilde;o para quaisquer informa&ccedil;&otilde;es que se fa&ccedil;am necess&aacute;rias</p>\r\n', 'CC', 'CC', 'graciele - 16/03/2017 10:03:07 - i'),
	(20, 'Termo de Distrato', '<p>O cliente abaixo indicado declara, outrosim, que concorda com a condi&ccedil;&atilde;o de pagamento da devolu&ccedil;&atilde;o, a qual lhe &eacute; devida em caso de desist&ecirc;ncia, nada mais tendo dela reclamar, no presente ou no futuro, judicial ou extrajudicial</p>\r\n', '<p>A empresa n&atilde;o se responsabilida pela falta de pagamento devido a dados bancarios fornecidos com erros ou por contas encerradas.</p>\r\n', 'TD', 'CD', 'suporte - 04/04/2017 13:04:36 - i'),
	(21, 'Carta de Rescisao', '<p>Na data abaixo declarada (data de contrato) , foi assinado contrato de compra e venda entre o COMPRADOR e VENDEDOR, envolvendo o lote e quadra mencionados. No entanto, devido ao atraso consecutivo de 03 (tres) parcelas, conforme estipulado em contrato assinado entre as partes, o mesmo fica automaticamente DISTRATADO.</p>\r\n\r\n<p>Para o recebimento do valor devido pedimos que entre em contato com nossa unidade fornecendo dados de banco, agencia e conta.</p>\r\n', '<p>Em raz&atilde;o disso, vez que o contrato est&aacute;desde ja rescindido, deve o COMPRADOR promover o retorno do bem ao VENDEDOR, no prazo maximo de 48 (quarenta e oito) hs a partir do recebimento desta.</p>\r\n', 'CR', 'CD', 'suporte - 04/04/2017 12:04:14 - i');
