REPLACE INTO `declaracoes` (`id`, `assunto`, `texto`) VALUES
	(18, 'Mudança de Propriedade', '<p>Informamos atrav&eacute;s desta que seu Loteamento foi adquirido por uma nova empresa, e a responsabilidade sobre a</p>\r\n\r\n<p>administra&ccedil;&atilde;o fica a cargo da Prospere &nbsp;Administra&ccedil;&atilde;o de Loteamentos Ltda &nbsp;que lhe d&aacute; as boas vindas.</p>\r\n\r\n<p>Esperamos servi-los da melhor forma poss&iacute;vel, desejando que sua satisfa&ccedil;&atilde;o seja plena e nossos la&ccedil;os de parceria</p>\r\n\r\n<p>sejam cada vez mais fortes.</p>\r\n\r\n<p>Aproveitamos para informar que toda e qualquer d&uacute;vida referente a Administra&ccedil;&atilde;o deste loteamento&nbsp;deve ser dada, &uacute;nica e</p>\r\n\r\n<p>exclusivamente, atrav&eacute;s de um de nossos canais de contato listados a seguir:</p>\r\n\r\n<p>- Prospere Adm de Loteamento&nbsp;- fone/fax (83) 3225-4080 - Av Acre, 446 sala 202&nbsp;- Bairro dos Estados - Joao Pessoa - PB</p>\r\n\r\n<p>- e-mail: administracao@prospereadm.com.br</p>\r\n\r\n<p>Agradecemos a aten&ccedil;&atilde;o dispensada e estaremos a disposi&ccedil;&atilde;o para quaisquer informa&ccedil;&otilde;es que se fa&ccedil;am necess&aacute;rias.</p>\r\n'),
	(6, 'Boas vindas', '<p>A Prospere Administra&ccedil;&atilde;o de Loteamentos Ltda lhe d&aacute; as boas vindas e com prazer inclui seu nome na lista de clientes.</p>\r\n\r\n<p>Esperamos servi-los da melhor forma poss&iacute;vel e aproveitamos para informar que desejamos que sua satisfa&ccedil;&atilde;o seja plena e nossos la&ccedil;os de parceria sejam cada vez mais fortes.</p>\r\n\r\n<p>Aproveitamos para informar que toda e qualquer d&uacute;vida referente a Administra&ccedil;&atilde;o deste loteamento&nbsp;deve ser dada, &uacute;nica e exclusivamente, atrav&eacute;s de um de nossos canais de contato listados a seguir:</p>\r\n\r\n<p>- Filial Garanhuns - Fones: (87) 3763-7145 - FIXO (87) 9931-5549 -TIM ou (87) 8130-1920 - VIVO &nbsp;- Av. Julio Brasileiro, 165 Heliop&oacute;lis Garanhuns-PE</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Agradecemos a aten&ccedil;&atilde;o dispensada.</p>\r\n'),
	(9, 'Doc. Transferencia PF', '<p><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-family:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\">Atrav&eacute;s da presente, informamos a Vossa Senhoria que para findar seu processo de transferencia h&aacute; </span></span></span></p>\r\n<p><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-family:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\">a necessidade&nbsp;</span>de c&oacute;pia&nbsp;leg&iacute;vel dos seguintes documentos:</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-family:\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Copia CPF e RG</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-family:\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Copia certidao de nascimento,se casado Certidao de Casamento ou Obito se viuvo.</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Se casado copia CPF e RG esposo(a)</p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-family:\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Copia de comprovante de endere&ccedil;o com Cep</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-family:\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Dados de profiss&atilde;o, telefones de contato e e-mail</span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-family:\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Comprovante de Transferencia Bancaria:</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Banco &nbsp; ____________________________ &nbsp; &nbsp;Agencia: &nbsp;_________________________</span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;color:\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;font-size:\\\\&quot;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Conta : _____________________________ &nbsp; &nbsp; &nbsp;Valor : __________________________</span></p>'),
	(7, 'Rescisao Contratual', '<p>Informamos a Vossa Senhoria que, tendo em vista o n&atilde;o comparecimento ao nosso chamado para quitar o seu d&eacute;bito,</p>\r\n<p>atrav&eacute;s&nbsp;de cartas enviadas anteriormente e telefonemas, e, estando de plena ci&ecirc;ncia do constante no Contrato de</p>\r\n<p>Compra e Venda&nbsp;firmado que o n&atilde;o pagamento de 03 parcelas e/ou a mais de 90 dias de inadimpl&ecirc;ncia d&atilde;o plenos</p>\r\n<p>poderes de rescis&atilde;o,&nbsp;comunicamos que o contrato encontra-se nesta data rescindido de pleno direito.</p>\r\n<p>Desta forma, pedimos a entrega do referido lote no estado em que lhe foi vendido, inteiramente desocupado</p>\r\n<p>at&eacute; 20 dias&nbsp;ap&oacute;s a data desta notifica&ccedil;&atilde;o.</p>\r\n<p>Informamos tamb&eacute;m que a partir deste momento n&atilde;o haver&aacute; mais preju&iacute;zo do cumprimento das demais obriga&ccedil;&otilde;es</p>\r\n<p>contratuais&nbsp;de ambas as partes, devido ao contrato ser considerado a partir desta data inteiramente extinto</p>'),
	(2, 'Procedimentos de assinatura - CONTRATO', '<p>Prezado Cliente.</p>\r\n\r\n<p>O(A) Sr(a) est&aacute; recebendo 03 (tr&ecirc;s) vias de contrato grampeadas individualmente.</p>\r\n\r\n<p>Estas dever&atilde;o ser <strong>rubricadas e assinadas (todas as folhas</strong> dos tr&ecirc;s contratos), aos casados &eacute; obrigat&oacute;rio a assinatura do conjuge nas 03 (tr&ecirc;s) vias.&nbsp;</p>\r\n\r\n<p>Pedimos tamb&eacute;m que duas testemunhas assinem colocando nomes completos e CPFs nos&nbsp;campos indicados.</p>\r\n\r\n<p>Junto aos contratos segue &nbsp;a &quot;carta de entrega de lote&quot; que deve ser assinada e devolvida juntamente com as demais vias do contrato.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Em caso de d&uacute;vidas entrar em contato pelos n&uacute;meros: (87) 3763-7145 - FIXO (87) 9931-5549 -TIM ou (87) 8130-1920 - VIVO</p>\r\n'),
	(8, 'Entrega Lote - CONTRATO', '<p>\r\n	Informo pelo presente que recebi o lote no loteamento acima mencionado, ficando ciente das dimens&otilde;es e localiza&ccedil;&atilde;o</p>\r\n<p>\r\n	f&iacute;sica do mesmo, al&eacute;m disso estou ciente de que em futura constru&ccedil;&atilde;o eu irei conferir a&nbsp;<span a=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" antes=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" ciente=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" da=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" devo=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" e=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" fazer=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" m=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" o=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" para=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" que=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" solicitar=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" span=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">demarca&ccedil;&atilde;o&nbsp;</span>com a escritura/contrato</p>\r\n<p>\r\n	evitando conflitos com lotes vizinhos, bem como respeitarei as regras contratuais referentes a constru&ccedil;&atilde;o, estando tamb&eacute;m</p>\r\n<p>\r\n	ciente da efetiva data de entrega do Loteamento.</p>\r\n<p>\r\n	Esta carta de entrega do lote n&atilde;o exime o promiss&aacute;rio comprador dos d&eacute;bitos existentes conforme contrato assinado.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ciente: &nbsp; ----------------------------------------------------------</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(assinatura)</p>\r\n'),
	(3, 'Doc. Transferencia PJ', '<p><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\">Atrav&eacute;s da presente, informamos a Vossa Senhoria que para findar seu processo de transferencia h&aacute; </span></span></span></p>\r\n<p><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\">a necessidade&nbsp;</span>de c&oacute;pia&nbsp;leg&iacute;vel dos seguintes documentos:</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Copia Contrato Social e ultima altera&ccedil;&atilde;o contratual</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Copia do cart&atilde;o CNPJ</p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;</span>Copia inscri&ccedil;&atilde;o estadual e municipal</p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;</span></span>Copia de comprovante de endere&ccedil;o com Cep da empresa</p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;</span></span>Copia RG e CPF do(s) s&oacute;cio(s)</p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;D</span>ados de profiss&atilde;o, telefones de contato e e-mail do(s) s&oacute;cio(s)</p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-family:\\\\\\\\&quot;\\\\&quot;\\">( &nbsp; &nbsp; ) &nbsp;Comprovante de Transferencia Bancaria:</span></span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Banco &nbsp; ____________________________ &nbsp; &nbsp;Agencia: &nbsp;_________________________</span></p>\r\n<p style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;color:\\\\\\\\&quot;\\\\&quot;\\"><span style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\&quot;\\\\&quot;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Conta : _____________________________ &nbsp; &nbsp; &nbsp;Valor : __________________________</span></p>'),
	(10, 'Carnet do IPTU', '<p>&nbsp;Prezado Cliente</p>\r\n<p>&nbsp;</p>\r\n<p>Estamos encaminhando a vossos cuidados o carnet de IPTU da prefeitura correspondente a seu lote no</p>\r\n<p>Loteamento acima listado, visto que conforme clausula nona - obriga&ccedil;&otilde;es do comprador a responsabilidade</p>\r\n<p>do pagamento dos mesmos s&atilde;o dos promissarios compradores.</p>\r\n<p>&nbsp;</p>\r\n<p>Estamos a disposi&ccedil;&atilde;o para quaisquer informa&ccedil;&otilde;es que se fa&ccedil;am necess&aacute;rias,</p>'),
	(11, 'Procedimentos de assinatura - TRANSFERENCIA', '<p>Prezado Cliente.</p>\r\n\r\n<p>O(A) Sra(a) est&aacute; recebendo 03 (tr&ecirc;s) vias do <strong>Termo Aditivo de Transferencia Contratual</strong>. Estas</p>\r\n\r\n<p>dever&atilde;o ser <strong>rubricadas na frente e assinadas no verso</strong>, mas apenas 1 (uma)&nbsp;via deve&nbsp;ser</p>\r\n\r\n<p>reconhecida firma em cart&oacute;rio das assinaturas do cedente e do cessionario (na mesma via).&nbsp;Pedimos tamb&eacute;m que duas testemunhas assinem&nbsp;colocando nomes completos e cpfs.</p>\r\n\r\n<p>Ap&oacute;s estes procedimentos nos <strong>devolver as tr&ecirc;s vias e a carta, </strong><strong>em at&eacute; 48 (quarenta e oito) horas</strong></p>\r\n\r\n<p>para&nbsp;que os Procuradores possam&nbsp;estar assinando, e na sequencia seja devolvida a sua via</p>\r\n\r\n<p>definitiva. Em caso de duvidas:</p>\r\n\r\n<p>- Prospere Adm de Loteamento&nbsp;- fone/fax (83) 3225-4080 - Av Acre, 446 sala 202&nbsp;- Bairro dos Estados - Joao Pessoa - PB</p>\r\n\r\n<p>- e-mail: administracao@prospereadm.com.br</p>\r\n'),
	(12, 'NOTIFICAÇÃO EXTRAJUDICIAL', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Pela Presente fica NOTIFICADO Vossa Senhoria a comparecer a sede da</p>\r\n\r\n<p>- Prospere Adm de Loteamento&nbsp;- fone/fax (83) 3225-4080 - Av Acre, 446 sala 202&nbsp;- Bairro dos Estados - Joao Pessoa - PB</p>\r\n\r\n<p>- e-mail: administracao@prospereadm.com.br</p>\r\n\r\n<p>no prazo improrrog&aacute;vel de 10 (dez)&nbsp; dias&nbsp; a contar da presente data</p>\r\n\r\n<p>mencionada&nbsp;neste termo a fim de <strong>regularizar pend&ecirc;ncias</strong> no contrato de Compra e&nbsp;Venda firmados, do</p>\r\n\r\n<p>Lote no&nbsp;Loteamento acima descritos.&nbsp;</p>\r\n\r\n<p>Informamos que o n&atilde;o cumprimento desta da-se a vendedora o direito, seguindo as clausulas&nbsp;contratuais</p>\r\n\r\n<p>de rescindir o contrato anteriormente firmado.</p>\r\n'),
	(13, 'Convite', '<p>Prezado Cliente</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A Construtora Daterra Ltda, convida a vossa senhoria a participar do Evento de Entrega do Loteamento Residencial</p>\r\n\r\n<p>Maravilha a realizar-se no dia:<strong>&nbsp; 24/11/2013 &agrave;s 8:00,&nbsp;</strong> no ex restaurante PIL&Atilde;O DE OURO em frente ao condom&iacute;nio,</p>\r\n\r\n<p>onde os Senhores poder&atilde;o degustar de um delicioso caf&eacute; da manh&atilde;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Agradecemos antecipadamente a vossa presen&ccedil;a e estamos a disposi&ccedil;&atilde;o atrav&eacute;s do telefone (83) para</p>\r\n\r\n<p>dirimir quaisquer d&uacute;vidas.</p>\r\n'),
	(26, 'Última Chamada para assinatura de contrato-  Lot. Residencial Alto Alegre', '<p>Prezado Cliente,</p>\r\n\r\n<p>Apesar de repetidas tentativas, ainda n&atilde;o conseguimos contato com o titular do lote.</p>\r\n\r\n<p>Solicitamos que ao receber esta correspond&ecirc;ncia o&nbsp;Sr(a) entre em contato com urg&ecirc;ncia,<strong>(atrav&eacute;s dos telefones abaixo)</strong>&nbsp;ou procure o&nbsp;nosso Escrit&oacute;rio Regional no endere&ccedil;o: Av. Visconde Inha&uacute;ma,765, Sala -102- Mauricio de Nassau - Caruaru- PE, para conclus&atilde;o da aquisi&ccedil;&atilde;o do lote. Evitando o cancelamento da reserva do mesmo.</p>\r\n\r\n<p>Prospere Administra&ccedil;&atilde;o de Loteamentos</p>\r\n\r\n<p>administracao@prospereadm.com.br &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>Telefones 83 3225-4080/ 83 9 99813355 ou&nbsp;83 9 99813344</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
	(14, 'Entrega Lote - Pós Entrega', '<p>\r\n	<span>Atrav&eacute;s da presente, informamos a Vossa Senhoria que o Loteamento encontra-se entregue e liberado para posse</span> <span>imediata</span></p>\r\n<p>\r\n	<span>a partir desta data, raz&atilde;o pela qual as parcelas vincendas ser&atilde;o reajustadas a juros previstos</span> <span>contratualmente.</span></p>\r\n<p>\r\n	E,&nbsp; pelo presente informo que recebi o lote no Loteamento acima mencionado, ficando ciente das dimens&otilde;es/localiza&ccedil;&atilde;o</p>\r\n<p>\r\n	f&iacute;sica do mesmo, e que neste momento confiro a <span a=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" antes=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" ciente=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" da=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" devo=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" e=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" fazer=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" m=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" o=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" para=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" que=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" solicitar=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" span=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\" style=\\"\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;font-size:\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\">demarca&ccedil;&atilde;o&nbsp;</span>e/ou fa&ccedil;o a conferencia&nbsp;da demarca&ccedil;&atilde;o a qual confere</p>\r\n<p>\r\n	com a&nbsp; escritura/contrato. Ciente de que na constru&ccedil;&atilde;o evitarei conflitos de metragem com lotes vizinhos, bem como</p>\r\n<p>\r\n	respeitarei as regras contratuais.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ciente: &nbsp; ----------------------------------------------------------&nbsp; Data:&nbsp; _____ / ______ / ______</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(assinatura)</p>\r\n<p>\r\n	PS: Esta carta de entrega do lote n&atilde;o exime o promiss&aacute;rio comprador dos d&eacute;bitos existentes conforme regras contratuais..</p>\r\n'),
	(16, 'Entrega de Loteamento', '<p>\r\n	<span>Atrav&eacute;s da presente, informamos a Vossa Senhoria que o Loteamento ja se encontra pronto e considerado entregue, a</span></p>\r\n<p>\r\n	<span>partir da data deste documento, raz&atilde;o pela qual as parcelas vincendas ser&atilde;o reajustadas a juros previstos contratualmente.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Estamos a &nbsp;disposi&ccedil;&atilde;o &nbsp;para maiores &nbsp;informa&ccedil;&otilde;es que se&nbsp;fa&ccedil;am necess&aacute;rias.<span>&nbsp;</span></p>\r\n'),
	(17, 'Notificação Extrajudicial - CONSTRUÇÃO', '<p>&nbsp; NOTIFICA&Ccedil;&Atilde;O EXTRAJUDICIAL</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Pela Presente fica NOTIFICADO Vossa Senhoria&nbsp;a comparecer a sede da</p>\r\n\r\n<p>- Prospere Adm de Loteamento&nbsp;- fone/fax (83) 3225-4080 - Av Acre, 446 sala 202&nbsp;- Bairro dos Estados - Joao Pessoa - PB</p>\r\n\r\n<p>- e-mail: administracao@prospereadm.com.br</p>\r\n\r\n<p>no prazo improrrog&aacute;vel</p>\r\n\r\n<p>de 10 (dez)&nbsp;&nbsp;dias&nbsp;&nbsp;a contar da presente data mencionada&nbsp;neste termo a fim de&nbsp;<strong>regularizar </strong></p>\r\n\r\n<p><strong>pend&ecirc;ncias formalizando acordo de pagamento</strong>&nbsp;das parcelas vencidas do contrato de Compra e</p>\r\n\r\n<p>Venda firmados, do Lote no&nbsp;Loteamento acima descritos.&nbsp;</p>\r\n\r\n<p>Lembramos que cartas anteriores ja foram enviadas sem sucesso de retorno, e como o lote possui</p>\r\n\r\n<p>constru&ccedil;&atilde;o e n&atilde;o havendo o interesse na negocia&ccedil;&atilde;o do &nbsp;referido debito, da-se a vendedora o direito,</p>\r\n\r\n<p>seguindo as clausulas&nbsp;contratuais de rescindir o contrato anteriormente firmado, e ainda proceder a</p>\r\n\r\n<p>negativa&ccedil;&atilde;o de vosso nome, com envio de dados para registro junto ao SPC e/ou SERASA, &nbsp;al&eacute;m</p>\r\n\r\n<p>da abertura de processo judicial.</p>\r\n'),
	(19, 'Parcela paga a menor', '<p>Em raz&atilde;o de pessoa n&atilde;o localizada pelos telefones constantes em nosso cadastro, pela Presente fica&nbsp;NOTIFICADO Vossa</p>\r\n\r\n<p>Senhoria&nbsp;a entrar em contato com a</p>\r\n\r\n<p>- Prospere Adm de Loteamento&nbsp;- fone/fax (83) 3225-4080 - Av Acre, 446 sala 202&nbsp;- Bairro dos Estados - Joao Pessoa - PB</p>\r\n\r\n<p>- e-mail: administracao@prospereadm.com.br</p>\r\n\r\n<p>no prazo improrrog&aacute;velde 10 (dez)&nbsp;dias a contar da presente data</p>\r\n\r\n<p>mencionada&nbsp;neste termo a fim de&nbsp;<strong>regularizar pend&ecirc;ncias</strong>&nbsp;no&nbsp;contrato de Compra e&nbsp;Venda firmados, do Lote</p>\r\n\r\n<p>no&nbsp;Loteamento acima descritos. Conforme segue:</p>\r\n\r\n<p>_____________________________________________________________________________________________</p>\r\n\r\n<p>_____________________________________________________________________________________________</p>\r\n\r\n<p>_____________________________________________________________________________________________</p>\r\n\r\n<p>_____________________________________________________________________________________________</p>\r\n\r\n<p>Informamos que o acerto de parcelas ser&aacute; em acrescimo na parcela posterior, por isso e para evitar juros&nbsp;e multas</p>\r\n\r\n<p>dos valores pagos a menor, pedimos retorno o mais breve poss&iacute;vel.</p>\r\n'),
	(20, 'Ausencia de Debitos', '<p>\r\n	Pelo presente instrumento, declaramos, que a pessoa acima qualificada, n&atilde;o possui d&eacute;bitos referente &agrave; pagamento de</p>\r\n<p>\r\n	parcelas mensais do lote e quadra do loteamento acima citado at&eacute; a data de hoje conforme condi&ccedil;&otilde;es mencionadas</p>\r\n<p>\r\n	no contrato de presta&ccedil;&atilde;o de servi&ccedil;os administrativos celebrado entre as partes.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	A presente declara&ccedil;&atilde;o, de acordo com a lei n&deg;: 12.007/2009 substitui, para a comprova&ccedil;&atilde;o do cumprimento das</p>\r\n<p>\r\n	obriga&ccedil;&otilde;es do consumidor, as quita&ccedil;&otilde;es dos faturamentos mensais dos d&eacute;bitos do mes e ano mencionado neste termo e</p>\r\n<p>\r\n	a dos anos anteriores.</p>\r\n'),
	(21, 'Antecipação de Parcela', '<p>Eu acima descrito estou ciente que pedi a PROSPERE ADMINISTRA&Ccedil;&Atilde;O DE LOTEAMENTOS&nbsp;um carnet de antecipa&ccedil;&atilde;o de parcelas, antes do reajuste anual, me comprometendo a paga-lo antes do reajuste anual deste contrato.</p>\r\n\r\n<p>Ficando ciente tamb&eacute;m que, caso n&atilde;o efetue os pagamentos at&eacute; a data de reajuste irei desprezar os boletos nele contidos, para efetuar o pagamento pelos novos com valor reajustado.</p>\r\n\r\n<p>Ciente tamb&eacute;m de que, caso efetue os pagamentos ap&oacute;s o reajuste com o carnet que estou em m&atilde;os irei pagar juros e multas sobre a diferenca paga a menor da parcela atualizada.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ciente:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>_________________________________</p>\r\n\r\n<p>Comprador</p>\r\n'),
	(22, 'Reajuste a Menor', '<p>A Prospere Administra&ccedil;&atilde;o de Loteamentos Ltda comunica que por decis&atilde;o dos s&oacute;cios do empreendimento o reajuste das parcelas, baseado no IGPM acumulado, de 11,09% <strong>foi reduzido</strong> para 5,16%.</p>\r\n\r\n<p>Esse benef&iacute;cio s&oacute; foi poss&iacute;el devido a <strong>baixa inadimpl&ecirc;ncia</strong> do loteamento, caso venha a subir n&atilde;o poder&aacute; mais ser concedido&nbsp;nos pr&oacute;ximos reajustes. Desda forma solicitamos aos clientes que matenham a rela&ccedil;&atilde;o de parceria para obterem benef&iacute;cios e valorizarem ainda mais seu im&oacute;vel.</p>\r\n\r\n<p>Em casso de d&uacute;vida utilize nossos canais de contato:</p>\r\n\r\n<p>Regional Garanhuns: fones: (87) 3763-7145 - (87) 9 9931-5549 -TIM ou (87) 9 8130-1920 - VIVO - Av. Julio Brasileiro, 165 Heliop&oacute;lis - Garanhuns/PE</p>\r\n\r\n<p>Agradecemos a aten&ccedil;&atilde;o dispensada.</p>\r\n'),
	(23, 'Boas Vindas- Caruaru', '<p>A Prospere Administra&ccedil;&atilde;o de Loteamentos Ltda lhe d&aacute; as boas vindas e com prazer inclui seu nome na lista de clientes.</p>\r\n\r\n<p>Esperamos servi-los da melhor forma poss&iacute;vel e aproveitamos para informar que desejamos que sua satisfa&ccedil;&atilde;o seja plena e nossos la&ccedil;os de parceria sejam cada vez mais fortes.</p>\r\n\r\n<p>Aproveitamos para informar que toda e qualquer d&uacute;vida referente a Administra&ccedil;&atilde;o deste loteamento&nbsp;deve ser dada, &uacute;nica e exclusivamente, atrav&eacute;s de um de nossos canais de contato listados a seguir:</p>\r\n\r\n<p>- Filial Caruaru&nbsp;- Fones:&nbsp;&nbsp;FIXO (83) 3225-4080&nbsp;-TIM (83) 9 9981-0037&nbsp;&nbsp;&nbsp;- Av. Visconde Inha&uacute;ma,765,Sala -102- Mauricio de Nassau - Caruaru- PE</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Agradecemos a aten&ccedil;&atilde;o dispensada.</p>\r\n'),
	(24, 'Procedimentos de assinatura- Contrato/ Caruaru', '<p>Prezado Cliente.</p>\r\n\r\n<p>O(A) Sr(a) est&aacute; recebendo 03 (tr&ecirc;s) vias de contrato grampeadas individualmente.</p>\r\n\r\n<p>Estas dever&atilde;o ser&nbsp;<strong>rubricadas e assinadas (todas as folhas</strong>&nbsp;dos tr&ecirc;s contratos), aos casados &eacute; obrigat&oacute;rio a assinatura do conjuge nas 03 (tr&ecirc;s) vias.&nbsp;</p>\r\n\r\n<p>Pedimos tamb&eacute;m que duas testemunhas assinem colocando nomes completos e CPFs nos&nbsp;campos indicados.</p>\r\n\r\n<p>Junto aos contratos segue &nbsp;a &quot;carta de entrega de lote&quot; que deve ser assinada e devolvida juntamente com as demais vias do contrato.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Em caso de d&uacute;vidas entrar em contato pelos n&uacute;meros: FIXO (83) 3225-4080 -TIM &nbsp;(83) 99981-0037</p>\r\n'),
	(25, 'INSTRUÇÕES PARA PREENCHIMENTO DO CONTRATO', '<p>Como parte do procedimento de contrata&ccedil;&atilde;o do seu lote, enviamos este contrato para leitura e assinatura. &Eacute; importante que <strong>siga todos as instru&ccedil;&otilde;es abaixo</strong> para finalizarmos o procedimento.</p>\r\n\r\n<p>1. Nosso contrato &eacute; formado pelos seguintes documentos:</p>\r\n\r\n<p>- Cartas de boas-vindas.</p>\r\n\r\n<p>- Termo de entrega de lote</p>\r\n\r\n<p>- Se&ccedil;&atilde;o I (Quadro resumo) 3x</p>\r\n\r\n<p>- Se&ccedil;&atilde;o lI 3x</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Todas as p&aacute;ginas devem ser assinadas em todas as vias nos locais assinalados, al&eacute;m de rubricas em todas as p&aacute;ginas. Aos casados deve-se constar as assinaturas do c&ocirc;njuge.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. Todos os documentos (e suas respectivas vias) devem ser retornados ao escrit&oacute;rio matriz da Prospere Administra&ccedil;&atilde;o de Loteamentos pelos correios por carta registrada.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. No mesmo envelope do contrato est&aacute; presente o carn&ecirc; de parcelas do lote, deve-se verificar se todas as parcelas do per&iacute;odo est&atilde;o presentes e em sequ&ecirc;ncia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. Apenas a &quot;carta de boas-vindas&quot;, o &quot;procedimento de assinatura&quot; e o boleto n&atilde;o necessitam de assinatura e devolu&ccedil;&atilde;o.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>COMO OS CONTRATOS E DEMAIS DOCUMENTOS FORAM ASSINADOS PELAS OUTRAS PARTES. CABE A VOSSA PARTE A RETIRADA DA SUA C&Oacute;PIA E REENVIOU DAS DUAS OUTRAS C&Oacute;PIAS (TAMB&Eacute;M ASSINADAS) &nbsp;PARA O ENDERE&Ccedil;O ABAIXO.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Endere&ccedil;o para reenvio do contrato:</strong></p>\r\n\r\n<p>Prospere Adm. de Loteamento</p>\r\n\r\n<p>Av. S&atilde;o Paulo, 1161</p>\r\n\r\n<p>Bairro dos Estados,</p>\r\n\r\n<p>Jo&atilde;o Pessoa-PB</p>\r\n\r\n<p>CEP: 58030-041</p>\r\n');
